namespace SpriteKind {
    export const stats = SpriteKind.create()
    export const UI = SpriteKind.create()
}
radio.onReceivedNumber(function (receivedNumber) {
    if (receivedNumber < 35) {
        mySprite2.setImage(list_creatures[receivedNumber])
    } else if (receivedNumber == 2020) {
        game.showLongText("enemy " + "billy" + "'s defense won't go any lower!", DialogLayout.Bottom)
    } else if (receivedNumber == 20200) {
        chooser = false
        turn_chooser = 1
        turn_number += 2
    } else if (receivedNumber == 3020) {
        game.showLongText("enemy " + "billy" + "'s defense fell!", DialogLayout.Bottom)
    } else if (receivedNumber == 4020) {
        game.showLongText("but nothing happens...", DialogLayout.Bottom)
    }
})
controller.anyButton.onEvent(ControllerButtonEvent.Pressed, function () {
    if (chooser == true) {
        if (enemy_turn == 0) {
            radio.sendNumber(20200)
            chooser = false
            turn_number += 2
        }
    }
})
controller.left.onEvent(ControllerButtonEvent.Pressed, function () {
    if (enemy_turn == 0) {
        radio.sendValue("powder", 3)
        game.showLongText("you used magic powder!", DialogLayout.Bottom)
        music.magicWand.play()
        turn_number += 1
    }
})
controller.right.onEvent(ControllerButtonEvent.Pressed, function () {
    if (enemy_turn == 0) {
        radio.sendValue("attack", atk)
        game.showLongText("you used attack!", DialogLayout.Bottom)
        music.pewPew.play()
        turn_number += 1
    }
})
radio.onReceivedString(function (receivedString) {
    game.over(true)
})
info.onLifeZero(function () {
    radio.sendString("ded")
    game.over(false)
})
radio.onReceivedValue(function (name, value) {
    if (name == "health") {
        enemy_health = value
    } else if (name == "attack") {
        health_on_hold = health
        game.showLongText("enemy " + "billy" + " used attack!", DialogLayout.Bottom)
        health += 0 - (value * 2 - def)
        music.pewPew.play()
        scene.cameraShake(5, 100)
        if (health > 100) {
            health = health_on_hold
            radio.sendNumber(4020)
            game.showLongText("but nothing happens...", DialogLayout.Bottom)
        }
        turn_number += 1
    } else if (name == "powder") {
        game.showLongText("enemy " + "billy" + " used magic powder", DialogLayout.Bottom)
        music.magicWand.play()
        if (def > 10) {
            def += 0 - value
            game.showLongText("your deffense fell!", DialogLayout.Bottom)
            radio.sendNumber(3020)
        } else {
            game.showLongText("your defense won't go any lower!", DialogLayout.Bottom)
            radio.sendNumber(2020)
        }
        turn_number += 1
    }
})
let health_on_hold = 0
let enemy_health = 0
let turn_number = 0
let turn_chooser = 0
let chooser = false
let enemy_turn = 0
let health = 0
let atk = 0
let def = 0
let list_creatures: Image[] = []
let mySprite2: Sprite = null
